class EmpleadosRegistriesComponent {
    constructor(employeeserv) {
        this.employeeserv = employeeserv;
        this.classes = 'row';
        this.showedifform = true;
        this.allemployees = [];
    }
    ngOnInit() {
        this.getallEmployees();
    }
    getallEmployees() {
        this.employeeserv.getEmployeesAll().subscribe(res => {
            console.log('res :>> ', res);
            this.allemployees = res;
        });
    }
    EditEmployee(form) {
        console.log('form.value :>> ', form.value);
        this.employeeserv.updateEmployee(form.value).subscribe(res => {
            console.log('res :>> ', res);
        });
        this.getallEmployees();
        form.reset();
    }
    AddNewEmp(form) {
        this.employeeserv.saveNewEmployee(form.value).subscribe(res => {
            console.log('res :>> ', res);
        });
        M.toast({ html: 'Empleado Agregado' });
        this.getallEmployees();
        form.reset();
    }
    addtoform(emps) {
        this.employeeserv.selectedemployee = emps;
        console.log('emps :>> ', emps);
    }
    hiddeeditform() {
        this.showaddform = true;
        this.showedifform = false;
    }
    showeditform() {
        this.showaddform = false;
        this.showedifform = true;
    }
    deleteempleado(form, id) {
        this.employeeserv.deleteEmployee(id).subscribe(res => {
            console.log('res :>> ', res);
        }, err => {
            M.toast({ html: err });
        });
        this.getallEmployees();
        form.reset();
    }
}
